import React from 'react';
import Form from './Form';
import Nav from './Nav';







class PhotoContainer extends React.Component {

  state = {

  };

  render(){
    return (
      <div className="photo-container">
        <h2>Results</h2>
        <ul>
          {this.props.images.map( image =>
            <Photo 
              images={image.src}
              key={image.id}
              alt={image.alt}
            />
          )}
          <Lost />
        </ul>
      </div>
    );
  }
}

const Photo = (props) => {
  return (
    <li><img src={props.images} alt={props.alt}></img></li>
  );
}

const Lost = () => {
  return (
    <li className="not-found">
      <h3>No Results Found</h3>
      <p>Your search did not return any results. Please try again.</p>
    </li>
  );
}

const App = (props) => {
  return (
    <div>
      <Form />
      <Nav />
      <PhotoContainer images={props.images}/>
    </div>
  );
}

export default App;
